['/* Coached by Dukkha */
#include <stdio.h>
#include <stdlib.h>

#define N 100000

int min(int a, int b) { return a < b ? a : b; }

int compare(const void *a, const void *b) {
	int ia = *(int *) a;
	int ib = *(int *) b;

	return ia - ib;
}

int solve(int l, int r, int x) {
	return min(abs(x - l) + abs(l - r), abs(x - r) + abs(r - l));
}

int main() {
	static int xx[N];
	int n, x, i;

	scanf("%d%d", &n, &x);
	for (i = 0; i < n; i++)
		scanf("%d", &xx[i]);
	qsort(xx, n, sizeof *xx, compare);
	printf("%d\n", n == 1 ? 0 : min(solve(xx[0], xx[n - 2], x), solve(xx[1], xx[n - 1], x)));
	return 0;
}
