['
#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define fo(i,a,b) for(i=(a);i<=(b);i++)
#define of(i,a,b) for(i=(a);i>=(b);i--)
#define max(a,b) (((a)>(b))?(a):(b))
#define min(a,b) (((a)<(b))?(a):(b))

typedef long long int lli;


void fastWrite(FILE * ofp, int x) {
    int i = 12;
    char buff[i];
    buff[i] = 0;
    int neg = 0;
    if (x < 0){
        x = -x;
        neg = 1;
    }
    if (x == 0)
        buff[--i] = '0';
    else while (x != 0) {
        buff[--i] = (x % 10) + '0';
        x /= 10;
    }
    if (neg)
        buff[--i] = '-';
    fwrite(buff + i, sizeof(char), (12 - i), ofp);
}
 
void fastSpace(FILE * ofp){
    fwrite(" ", sizeof(char), 1, ofp);
}
void fastChar(FILE * ofp, char c){
    fwrite(&c, sizeof(char), 1, ofp);
}
void fastNewLine(FILE * ofp) {
    fwrite("\n", sizeof(char), 1, ofp);
}

void sort(int * arr, int s, int e) {
   if (s >= e)
      return;
   int i,j;
   if (s + 4 >= e)fo(i,s,e)fo(j,s,e-1)
      if (arr[j] < arr[j+1]){
         arr[j]^=arr[j+1];
         arr[j+1]^=arr[j];
         arr[j]^=arr[j+1];
      }
   int len = e-s+1;
   int * dum = calloc(len, sizeof(int));
   int m = (s+e)/2;
   sort(arr,s,m);
   sort(arr,m+1,e);
   int fp = s;
   int bp = m+1;
   int mp = 0;
   fo(mp,0,len-1) {
      if (fp == m+1 || 
         (bp != e+1 && 
         (arr[bp] < arr[fp])))
         dum[mp] = arr[bp++];
      else
         dum[mp] = arr[fp++];
   }
   fo(mp,0,len-1)
      arr[mp+s]=dum[mp];
}

int readInt()
{
   int n;
   scanf("%d", &n);
   return n;
}
char readChar()
{
   char n;
   scanf(" %c", &n);
   return n;
}
char * readStr(int max)
{
   char * ret;
   char * buf;
   buf = calloc(max + 1, sizeof(char));
   scanf("%s", buf);
   ret = calloc(strlen(buf)+1,sizeof(char));
   strcpy(ret, buf);
   free(buf);
   return ret;
}

char isUpper(char c){
   return (c>='A' && c <='Z');
}

void printArray(int * arr, int size){
   int i;
   fo(i,0,size-1)
      printf("%d%s", arr[i], (i==size-1)?"\n":" ");
}

int main()
{
   int n = readInt();
   int max = readInt();
   int was = readInt();
   int in = 0;
   int ans = 0;
   while(n-->0){
      int a = readInt();
      if (a > max)
         continue;
      in += a;
      if (in > was) {
         in = 0;
         ans++;
      }
   }
   fastWrite(stdout,ans);
   fastNewLine(stdout);
   return 0;
}']
